import AnimOnView from "../anim/AnimOnView"

import forAllTnIcon from "../../media/f-a-tn-icon.jpg"

const Projects = (props) => {

    return (
        <div className='Projects full-screen'>
            <AnimOnView>

                <Project icon={forAllTnIcon}/>

            </AnimOnView>
        </div>
    );
} 

export default Projects;
